                  '\n          Juicy watermelons, delectable peaches, addictive black plums (jamun), and of course, perhaps the king of all\n          fruits in Pakistan: mangoes \u2014 all of these and more are summer\u2019s gifts. The chaunsa variety of mango is unique\n          to Pakistan and offers an unbelievably fresh and pulpy taste. On the street food side of things, the landscape\n          also shifts with treats like lemon soda, falooda (an embellished ice cream-based dessert), and the\n          ever-refreshing ganay ka ras (sugarcane juice) make their way to hawkers everywhere.\n        '
